import React from 'react';
import { MDBBtn, MDBCard, MDBCardBody, MDBCardTitle, MDBCardText, MDBCol } from 'mdbreact';

const PortfolioCard = props => {
  return (
    <MDBCol>
      <MDBCard>
        {/* <MDBCardImage className="img-fluid" src={props.portfolios.image} waves /> */}
        <MDBCardBody>
          <MDBCardTitle>{props.portfolio.name}</MDBCardTitle>
          <MDBCardText>
            {props.portfolio.description}
          </MDBCardText>
          <MDBBtn href="#">{props.portfolio.name}</MDBBtn>
        </MDBCardBody>
      </MDBCard>
    </MDBCol>
  )
}

export default PortfolioCard;
